import React from 'react'
import { useSelector } from 'react-redux'

function CartData() {
    const state = useSelector(state=>state.productReducer.cart)

    const showCartData = ()=>{
        (
            state.map((items)=>(
                <div className="col-md-6">
                    <img src={items.thumbnail} alt="" height={'300px'} />
                </div>
            ))
        )
    }
  return (
    <div>
    {
        showCartData()
    }
    </div>
  )
}

export default CartData
